  if (arg[0]) {
    casadi_copy(arg[0], 725, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 725);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 725, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 725);
  }
  if (arg[7]) {
    casadi_copy(arg[7], 724, d_nlp.lam+725);
  } else {
    casadi_clear(d_nlp.lam+725, 724);
  }
  if (arg[2]) {
    casadi_copy(arg[2], 725, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 725, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 725, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 725, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 724, d_nlp.lbz+725);
  } else {
    casadi_fill(d_nlp.lbz+725, 724, -casadi_inf);
  }
  if (arg[5]) {
    casadi_copy(arg[5], 724, d_nlp.ubz+725);
  } else {
    casadi_fill(d_nlp.ubz+725, 724, casadi_inf);
  }
  d.prob = &p;
  p.sp_h = casadi_s13;
  p.sp_a = casadi_s9;
  p.merit_memsize = 4;
  p.max_iter_ls = 3;
  p.nlp = &p_nlp;
